window.bookSummaryJSON = "<p>They took me by surprise, and now I'm forced to hold my breath. An anger burns inside me that can't be extinguished. Jax, Blake, and Morgan made the wrong choice, and now they're going to pay. The thing is, I don't want to hurt them. Can I forgive them or will I let my anger consume me? I'm changing and I don't know if I like what I've become. A new threat leaves me with a choice....do I sink or do I swim?</p> <p><i>Submerge</i> is book 2 in the Salinity Cove series.</p>"; 
